
public class Operator2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

	int a = 18;
	int b = 20;
	boolean c = a>=b;
	boolean c1 = a<=b;
	boolean c2 = a<=b;
	boolean d1 = c1&&c2;
	
	System.out.println(d1);
	
	boolean d2 = !(c1&&c2);
	
	System.out.println(d2);
	
	
	}

}
